    false,nt"url": null,nt"notes": "American Samoa's coral reefs have been
    impacted by a variety of major events, including periodic severe hurricanes, the
    most recent of which was Hurricane Heta, which was closest on Jan 6, 2004. Other
    events have included a Crown-of-Thorns seastar outbreak in 1974 and night scuba
    spearfishing from 1994-2002. Mass coral bleaching occurred in 1994 and then again
    in the summers of 2002 and 2003, and the bleaching was severe enough to kill some
    corals. Bi-weekly surveys were made of the reefs at Airport Lagoon. During the peak
    of the summer bleaching, surveys were made at five other locations. The data given
    with this data set refer to the percent corals bleached within the survey area.",nt"owner_org":
